// 파일: App.js

import React, { useState, useEffect } from 'react';
import {
  BrowserRouter as Router,
  Route,
  Routes,
  Link
} from 'react-router-dom';
import Header from './components/Header';
import ParcelList from './components/ParcelList';
import AddModal from './components/AddModal';
import EditModal from './components/EditModal';

function App() {
  const [parcels, setParcels] = useState([]);

  // 데이터를 로드하는 useEffect 추가
  useEffect(() => {
    // 실제 API 호출 부분을 대체할 가짜 데이터
    const mockParcels = [
      {
        id: 1,
        tracking_number: "123456789",
        sender_name: "홍길동",
        recipient_name: "김철수",
        recipient_address: "서울시 강남구",
        status: "배송 중",
        cost: 5000
      },
      {
        id: 2,
        tracking_number: "987654321",
        sender_name: "이영희",
        recipient_name: "박영수",
        recipient_address: "부산시 해운대구",
        status: "배송 완료",
        cost: 8000
      }
    ];
    setParcels(mockParcels);
  }, []);

  return (
    <Router>
      <div className="App">
        <Header />
        <nav>
          <ul>
            <li><Link to="/">Home</Link></li>
            <li><Link to="/add">Add Parcel</Link></li>
            <li><Link to="/edit">Edit Parcel</Link></li>
          </ul>
        </nav>
        <Routes>
          <Route path="/" element={<ParcelList parcels={parcels} />} />
          <Route path="/add" element={<AddModal />} />
          <Route path="/edit" element={<EditModal />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
